// Dashboard.js
import React, { useState } from "react";
import { Navbar, Footer } from "../pages/CommonUI";

const Dashboard = () => {
  const [isDarkMode, setIsDarkMode] = useState(false);
  const [isLoggedIn] = useState(true); // since user is logged in

  const toggleDarkMode = () => setIsDarkMode(!isDarkMode);

  return (
    <div
      style={{
        fontFamily: "'Poppins', sans-serif",
        minHeight: "100vh",
        backgroundColor: isDarkMode ? "#121212" : "#F4F7F4",
        color: isDarkMode ? "#f1f1f1" : "#222",
        transition: "all 0.3s",
      }}
    >
      {/* Navbar */}
      <Navbar
        isDarkMode={isDarkMode}
        toggleDarkMode={toggleDarkMode}
        isLoggedIn={isLoggedIn}
      />

      {/* Dashboard Content */}
      <div
        style={{
          padding: "50px",
          textAlign: "center",
        }}
      >
        <h1>Welcome to Your Dashboard</h1>
        <p>
          Here you can access all your practice sets, view your results, and
          track your progress.
        </p>

        <div
          style={{
            marginTop: "30px",
            display: "flex",
            justifyContent: "center",
            gap: "40px",
            flexWrap: "wrap",
          }}
        >
          <div
            style={{
              backgroundColor: isDarkMode ? "#1E1E1E" : "#145A32",
              color: isDarkMode ? "#f1f1f1" : "#fff",
              padding: "30px",
              borderRadius: "10px",
              width: "200px",
              fontWeight: "bold",
              cursor: "pointer",
              transition: "all 0.3s",
            }}
          >
            Practice Sets
          </div>
          <div
            style={{
              backgroundColor: isDarkMode ? "#1E1E1E" : "#145A32",
              color: isDarkMode ? "#f1f1f1" : "#fff",
              padding: "30px",
              borderRadius: "10px",
              width: "200px",
              fontWeight: "bold",
              cursor: "pointer",
              transition: "all 0.3s",
            }}
          >
            My Results
          </div>
          <div
            style={{
              backgroundColor: isDarkMode ? "#1E1E1E" : "#145A32",
              color: isDarkMode ? "#f1f1f1" : "#fff",
              padding: "30px",
              borderRadius: "10px",
              width: "200px",
              fontWeight: "bold",
              cursor: "pointer",
              transition: "all 0.3s",
            }}
          >
            Profile
          </div>
        </div>
      </div>

      {/* Footer */}
      <Footer />
    </div>
  );
};

export default Dashboard;
